PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE game_stats (
	id INTEGER NOT NULL, 
	replay_file VARCHAR(500) NOT NULL, 
	game_version VARCHAR(50), 
	map VARCHAR(100), 
	game_type VARCHAR(50), 
	duration INTEGER, 
	winner VARCHAR(100), 
	players TEXT, 
	event_types TEXT, 
	key_events TEXT, 
	timestamp DATETIME, 
	played_on DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (replay_file)
);
COMMIT;
